import React from "react";
import "./css/Banner.css";
import banner_bcg from "./Images/banner_bcg.svg";

function Banner() {
  return (
    <div
      style={{
        backgroundImage: `url(${banner_bcg})`,
      }}
      className="banner__container"
    ></div>
  );
}

export default Banner;
